import "../css/doctor-appointments.css";
import avatar from "../avatar.jpg";

import { util } from "../public/util";
import CustomPagination from "../inputs/custom-pagination";
import { useEffect, useState } from "react";

const DoctorAppointments = ({ ...props }) => {
  const [data, setData] = useState([]);
  useEffect(() => {
      setData(props.appointments)
  }, [props.appointments])
  return (
    <CustomPagination data={props.appointments.filter((item) =>  util.sameDay(new Date(item.start), new Date()))}>
      {data.map((apmt, i) => {
        return (
          util.sameDay(new Date(apmt.start), new Date()) && (
            <div className="appointment" key={"apmt" + i}>
              <div className="d-flex justify-content-between">
                <div>
                  <img src={avatar} className="patient-profile-img" alt="" />
                  <span className="px-3">patient</span>
                </div>
                <span>{apmt.title}</span>
              </div>
              <div className="content">
              <table>
                <tbody>
                <tr>
                    <th>
                      <td>Appointment Title</td>
                      <td>{apmt.title}</td>
                    </th>
                  </tr>
                  <tr>
                    <th>
                      <td>Start Time</td>
                      <td>{apmt.start.split("T")[1]}</td>
                    </th>
                  </tr>
                  <tr>
                    <th>
                      <td>End Time</td>
                      <td>{apmt.end.split("T")[1]}</td>
                    </th>
                  </tr>

                </tbody>
              </table>
              </div>
            </div>
          )
        );
      })}
    </CustomPagination>
  );
};

export default DoctorAppointments;
